import React from "react";
import { Route, BrowserRouter } from "react-router-dom";
import { useRoutes } from "./pages/Routes";


const MainPage = () => {
    const routes = useRoutes(true);
    return (
        <BrowserRouter>
            <Route>
                {routes}
            </Route>
        </BrowserRouter>
    )
}

export default MainPage;
